import React from "react";
import PopupWithForm from "./PopupWithForm";

function ConfirmDeleteCardPopup({ isOpen, onClose, onConfirm }) {
  function handleCardDelete(e) {
    e.preventDefault();
    onConfirm();
  }

  return (
    <PopupWithForm
      name="confirm"
      title="Вы уверены?"
      submit="Да"
      isOpen={isOpen}
      onClose={onClose}
      onSubmit={handleCardDelete}
    />
  );
}

export default PopupWithConfirmation;
